import logo from './logo.svg';
import './App.css';
import React, { useState } from 'react';

const Navigation = () => (
  <nav className="flex items-center justify-between p-4 bg-white">
    <div className="flex items-center space-x-2">
      <div className="w-10 h-10 bg-blue-500 rounded-lg"></div>
      <div>
        <h1 className="text-xl font-bold">chatUni AI</h1>
        <p className="text-sm text-gray-600">—  —</p>
      </div>
    </div>

    <div className="flex space-x-6">
      <a href="#" className="text-gray-600 hover:text-gray-900">Foundation Model</a>
      <a href="#" className="text-gray-600 hover:text-gray-900">Research</a>
      <a href="#" className="text-gray-600 hover:text-gray-900">Safety</a>
      <a href="#" className="text-gray-600 hover:text-gray-900">Company</a>
    </div>

    <button className="px-6 py-2 text-white bg-blue-600 rounded-lg hover:bg-blue-700">
      Test Our AI
    </button>
  </nav>
);

const AnnouncementBar = () => (
  <div className="p-4 text-white bg-green-500 flex justify-between items-center">
    <p className="text-lg">Education AI Teams with Tech Leaders to Launch Nation's AI</p>
    <img src="/api/placeholder/100/40" alt="Partner logo" className="h-8" />
  </div>
);

const RoleSelector = ({ selectedRole, onRoleSelect }) => {
  const roles = ['All', 'Role1', 'Role2', 'Role3', 'Role4'];

  return (
    <div className="flex justify-center space-x-4 my-8">
      {roles.map(role => (
        <button
          key={role}
          onClick={() => onRoleSelect(role)}
          className={`px-6 py-2 rounded-full border ${
            selectedRole === role
              ? 'bg-green-500 text-white border-green-500'
              : 'border-green-500 text-green-500 hover:bg-green-50'
          }`}
        >
          {role}
        </button>
      ))}
    </div>
  );
};

const ServiceCard = ({ icon, title }) => (
  <div className="flex flex-col items-center p-4 hover:bg-gray-50 rounded-lg cursor-pointer">
    <div className="w-12 h-12 flex items-center justify-center text-gray-600 mb-2">
      {icon}
    </div>
    <p className="text-sm text-gray-600">{title}</p>
  </div>
);

const HealthcareApp = () => {
  const [selectedRole, setSelectedRole] = useState('All');

  const services = [
    { icon: '🔄', title: 'All' },
    { icon: '👨‍⚕️', title: 'Pre-op' },
    { icon: '🏥', title: 'Discharge' },
    { icon: '❤️', title: 'Chronic Care' },
    { icon: '📋', title: 'Questionnaire' },
    { icon: '⚕️', title: 'VBC/At Risk' },
    { icon: '🧪', title: 'Clinical Trials' },
    { icon: '💊', title: 'Pharmacy' },
    { icon: '🏥', title: 'Natural Disaster' }
  ];

  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-50 to-green-50">
      <Navigation />
      <AnnouncementBar />

      <main className="container mx-auto px-4 py-12">
        <h1 className="text-5xl font-bold text-center text-green-600 mb-8">
          Safety Focused Generative AI for Healthcare
        </h1>

        <div className="max-w-4xl mx-auto">
          <h2 className="text-2xl font-semibold text-center mb-6">
            Choose a Role to Get Started
          </h2>

          <RoleSelector 
            selectedRole={selectedRole} 
            onRoleSelect={setSelectedRole} 
          />

          <div className="grid grid-cols-5 gap-4 mt-8">
            {services.map((service, index) => (
              <ServiceCard 
                key={index}
                icon={service.icon}
                title={service.title}
              />
            ))}
          </div>
        </div>
      </main>
    </div>
  );
};

export default HealthcareApp;
